`fielddecimal2` decimal(20,2) DEFAULT NULL COMMENT '主数据默认金额字段',
`fielddecimal3` decimal(20,2) DEFAULT NULL COMMENT '主数据默认金额字段',
`fielddecimal4` decimal(20,2) DEFAULT NULL COMMENT '主数据默认金额字段',
`fielddecimal5` decimal(20,2) DEFAULT NULL COMMENT '主数据默认金额字段',
`fieldlong1` bigint DEFAULT NULL COMMENT '主数据默认long字段',
`fieldlong2` bigint DEFAULT NULL COMMENT '主数据默认long字段',
`fieldlong3` bigint DEFAULT NULL COMMENT '主数据默认long字段',
`fieldlong4` bigint DEFAULT NULL COMMENT '主数据默认long字段',
`fieldlong5` bigint DEFAULT NULL COMMENT '主数据默认long字段',
`fielddate1` datetime DEFAULT NULL COMMENT '主数据默认日期字段',
`fielddate2` datetime DEFAULT NULL COMMENT '主数据默认日期字段',
`fielddate3` datetime DEFAULT NULL COMMENT '主数据默认日期字段',
`fielddate4` datetime DEFAULT NULL COMMENT '主数据默认日期字段',
`fielddate5` datetime DEFAULT NULL COMMENT '主数据默认日期字段',
`fieldtext0` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '主数据默认文本字段',
`fieldtext1` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '主数据默认文本字段',
`fieldtext2` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '主数据默认文本字段',
`fieldtext3` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '主数据默认文本字段',
`fieldtext4` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '主数据默认文本字段',
`fieldtext5` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '主数据默认文本字段',
`fieldtext6` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '主数据默认文本字段',
`fieldtext7` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '主数据默认文本字段',
`fieldtext8` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '主数据默认文本字段',
`fieldtext9` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '主数据默认文本字段',

`old_id` bigint  NULL COMMENT '转化的时候使用的id',
